/**
 * Dynamic {@link MapTestSuiteBuilder Map test suite} for {@link LinkedTreeMap}. This complements
 * {@link LinkedTreeMapTest}.
 */
@RunWith(AllTests.class)
public class LinkedTreeMapSuiteTest {

    private static class MapGenerator extends TestStringMapGenerator {

        private final boolean allowNullValues;

        public MapGenerator(boolean allowNullValues) {
            this.allowNullValues = allowNullValues;
        }

        @Override
        protected Map<String, String> create(Entry<String, String>[] entries) {
            // This is not completely accurate: Because LinkedTreeMap has no constructor which accepts
            // existing entries, this has to add the entries individually with `Map#put`
            var map = new LinkedTreeMap<String, String>(allowNullValues);
            for (var entry : entries) {
                map.put(entry.getKey(), entry.getValue());
            }
            return map;
        }
    }

    private static Feature<?>[] createFeatures(Feature<?>... additionalFeatures) {
        // Don't specify CollectionFeature.SERIALIZABLE because Guava testlib seems to assume
        // deserialized Map has same properties as original map (e.g. disallowing null keys), but this
        // is not the case for LinkedTreeMap which is serialized as JDK LinkedHashMap
        var features = new ArrayList<Feature<?>>(List.of(CollectionSize.ANY, MapFeature.ALLOWS_ANY_NULL_QUERIES, // Map only allows comparable keys
        MapFeature.RESTRICTS_KEYS, MapFeature.SUPPORTS_PUT, MapFeature.SUPPORTS_REMOVE, // Affects keySet, values and entrySet (?)
        // Map preserves insertion order
        CollectionFeature.KNOWN_ORDER, CollectionFeature.SUPPORTS_ITERATOR_REMOVE));
        features.addAll(Arrays.asList(additionalFeatures));
        return features.toArray(Feature[]::new);
    }

    // Special method recognized by JUnit's `AllTests` runner
    public static Test suite() {
        var nullValuesSuite = MapTestSuiteBuilder.using(new MapGenerator(true)).withFeatures(createFeatures(MapFeature.ALLOWS_NULL_VALUES)).named("nullValues=true").createTestSuite();
        var nonNullValuesSuite = MapTestSuiteBuilder.using(new MapGenerator(false)).withFeatures(createFeatures()).named("nullValues=false").createTestSuite();
        // Use qualified class name to make it easier to find this test class in the IDE
        TestSuite testSuite = new TestSuite(LinkedTreeMapSuiteTest.class.getName());
        testSuite.addTest(nullValuesSuite);
        testSuite.addTest(nonNullValuesSuite);
        return testSuite;
    }
}

